import React from 'react';
import Nero from '../img/Nero.jpg';
import '../App.css';

class Post extends React.Component {
    render() {
        return(
            <section class="container-fluid risoluzione">
              
            <div class="responsive1 filterDiv tecnologia">
            <div class="gallery">
              <div class="content">
                <div class="content-overlay">
                    <div class="card">
                      <img src={Nero} class="card-img-top" alt="..." style={{maxWidth:'auto', maxHeight: '50px'}}/>
                      <div class="card-body" >
                        <h5 class="card-title">Tecnologia Scritto dopo</h5>
                        <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                        
                        <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                        <a href="post.html"><button class="btn1 big-button">LEGGI ARTICOLO</button></a>
                      </div>
                    </div>
                  </div>
              </div>
            </div>
          </div>
          </section>
        )
    }
}

export default Post;
